pragma solidity ^0.6.0;

contract Ownable{
    address payable public _owner;

    constructor() public {
        _owner = msg.sender;
    }

    modifier onlyOwner(){
        require(isOwner(), "You are not owner");
        _;
    }

    function isOwner() public view returns(bool){
        return (msg.sender == _owner);
    }
}

